<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.0 Transitional//EN" "http://www.w3.org/TR/REC-html40/loose.dtd">
<html>
<head>
<title>pmd xml difference report</title>
<style type="text/css" media="all">@import url("./css/maven-base.css");@import url("./css/maven-theme.css");</style>
</head>
<body class="composite"><div id="contentBox">
<div class="section" id="Summary">
<h2>Summary:</h2>
<table class="bodyTable" border="0">
<thead><tr>
<th>Item</th>
<th>Base</th>
<th>Patch</th>
<th>Difference</th>
</tr></thead>
<tbody>
<tr>
<td class="c"><a href="#Errors">number of errors</a></td>
<td class="removed">0</td>
<td class="new">0</td>
<td class="c">
<span class="removed">-0</span> | <span class="added">+0</span>
</td>
</tr>
<tr>
<td class="c"><a href="#Violations">number of violations</a></td>
<td class="removed">0</td>
<td class="new">0</td>
<td class="c">
<span class="removed">-0</span> | <span class="changed">~0</span> | <span class="added">+0</span>
</td>
</tr>
<tr>
<td class="c"><a href="#configerrors">number of config errors</a></td>
<td class="removed">0</td>
<td class="new">0</td>
<td class="c">
<span class="removed">-0</span> | <span class="added">+0</span>
</td>
</tr>
<tr>
<td class="c">execution time</td>
<td class="removed">0</td>
<td class="new">0</td>
<td class="c">0</td>
</tr>
<tr>
<td class="c">timestamp</td>
<td class="removed"></td>
<td class="new"></td>
<td class="c"></td>
</tr>
</tbody>
</table>
</div>
<div class="section" id="Violations">
<h2>Violations:</h2>
<h3>No differences found!</h3>
</div>
<div class="section" id="Errors">
<h2>Errors:</h2>
<h3>No differences found!</h3>
</div>
<div class="section" id="configerrors">
<h2>Configuration Errors:</h2>
<h3>No differences found!</h3>
</div>
</div></body>
</html>
